import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap'

function App() {
  return (
    <div className="App">
    <Card>
      <Card.Body>This is some text within a card body.</Card.Body>
    </Card>
    </div>
  );
}

export default App;
